        "name_loc": "Sticky Napalm",
        "desc_loc": "Drenches an area in sticky oil, amplifying damage from Batrider's attacks and abilities and slowing the movement speed and turn rate of enemies in the area.  Additional casts of Sticky Napalm continue to increase damage, up to %max_stacks% stacks. Applies a small amount of damage with each cast.",
        "lore_loc": "It's not uncommon to hear the Rider cackle while he increases the flammability of his opponents.",
