        "name": "chen_holy_persuasion",
        "name_loc": "Holy Persuasion",
        "desc_loc": "Chen takes control of an enemy or neutral creep and receives gold equal to its bounty. If the persuaded creep's base health is naturally below the health minimum, its base health will be raised to the health minimum. Converted creeps will have increased movement speed and bonus damage.",
        "lore_loc": "Although they may not be knights, Chen incorporates beasts into the Fold in the same way he himself was converted.",
        "notes_loc": [
          "Persuading a new creep above max unit count causes the oldest persuaded creep to die.",
          "Can target Ancient creeps when Chen has Aghanim's Shard.",
          "The health of creeps already under Chen's control does not update to the new level upon leveling Holy Persuasion further.",
          "Fully restores the creep's mana upon converting."
        ],
        "shard_loc": "Allows Holy Persuasion to target Ancient creeps. Can control up to 1/2/3 Ancient creeps based on Hand of God's level. Additionally levels up some abilities of creeps by 1 level.",
